import styled from "@emotion/styled";

export const Header = styled.header`
  width: 100%;
  height:60px;
  display:grid;
  justify-content: space-between;
  align-content:center;
  grid-auto-flow: column;
  padding: 0 32px;
`

export const HeaderSection = styled.div`
  display:grid;
  justify-content: start;
  align-content:center;
  grid-auto-flow: column;
  grid-gap: 16px;
  `
